import NavbarSty from "../components/Navbar.js";
import styled from "styled-components";

export default function Cart() {
  return (
    <>
      <NavbarSty />
      <ProdListSty></ProdListSty>
    </>
  );
}

const ProdListSty = styled.div`
  background-color: green;
  height: 120px;
`;
